import React, { useState } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  height: 1000px;
  background-color: blue;
`;

const CalendarHeader = styled.div`
  position: fixed;
  width: 100%;
  height: 40px;
  top: 0;
`;

const Calendar = () => {
  return (
    <Container> 
      <CalendarHeader />

    </Container>
  );
}  

export default Calendar;
